import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { FormsModule } from '@angular/forms';
import { AdminComponent} from './admin/admin.component';
import { EmployeeComponent } from './employee/employee.component';
import { HeaderComponent } from './header/header.component';
import { EmployeeAddComponent } from './admin/employee-add/employee-add.component';
import { InfoComponent } from './info/info.component';
import { DirectivesDirective } from './directives.directive';
import { LoggingService } from './logging-service';
import { EmployeeService } from './employee-service';
import { Routes, RouterModule } from '@angular/router';
import { WelcomeComponent } from './admin/welcome/welcome.component';
import { EmployeeinfoComponent } from './employee/employeeinfo/employeeinfo.component';

const appRoutes: Routes = [
  { path: '',component:AdminComponent},
  { path: 'admin', component : AdminComponent},
  { path: 'employee', component: EmployeeComponent},
  { path: 'info', component: InfoComponent},
  { path : 'admin/addemployee', component: EmployeeAddComponent},
  { path : 'home', component: WelcomeComponent},
  { path : 'employee/:id', component: EmployeeinfoComponent }
];

@NgModule({
  declarations: [
    AdminComponent,
    AppComponent,
    EmployeeComponent,
    HeaderComponent,
    EmployeeAddComponent,
    InfoComponent,
    DirectivesDirective,
    WelcomeComponent,
    EmployeeinfoComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule,
    FormsModule,
    RouterModule.forRoot(appRoutes)
  ],
  providers: [LoggingService, EmployeeService],
  bootstrap: [AppComponent]
})
export class AppModule { }
